import React, { useEffect } from 'react';
import { List, Badge, Collapse } from 'antd';

const data = [
    {
        req: 1,
        title: "누상동 다목적 운동장",
        description: "인도어풋살장",
        content: "우레탄이 아닌 풋살장입니다"
    },
    {
        req: 2,
        title: "누상동 다목적 운동장",
        description: "인도어풋살장",
        content: "우레탄이 아닌 풋살장입니다"
    },
    {
        req: 3,
        title: "누상동 다목적 운동장",
        description: "인도어풋살장",
        content: "우레탄이 아닌 풋살장입니다"
    },
    {
        req: 4,
        title: "누상동 다목적 운동장",
        description: "인도어풋살장",
        content: "우레탄이 아닌 풋살장입니다"
    }
];
const StadiumList = () => {
    return (
        // <Collapse defaultActiveKey={["list"]}>
        //     <Collapse.Panel header="구장 리스트" key="list">
        <List
            header={<div>구장 리스트</div>}
            style={{ height: '70vh' }}
            grid={{ xs: 2, sm: 4, md: [0, 8] }}
            size="small"
            itemLayout="vertical"
            pagination={{
                onChange: page => {
                    console.log(page);
                },
                showLessItems: true,
            }}
            dataSource={data}
            renderItem={item => (
                <List.Item
                    key={item.req}
                >
                    <List.Item.Meta
                        title={item.title}
                        description={item.description}
                    />
                    {item.content}
                </List.Item >
            )}
        >

        </List >
        //     </Collapse.Panel>
        // </Collapse>
    )
}

export default StadiumList;
